import React from "react";
import { Link, NavLink } from "react-router-dom";
import Services from "./../Pages/Services";

function Header() {
  return (
    <div>
      <NavLink
        to="/home"
        activeStyle={{
          fontWeight: "bold",
          color: "blue",
        }}
      >
        Home
      </NavLink>
      <NavLink
        to="/about"
        activeStyle={{
          fontWeight: "bold",
          color: "blue",
        }}
      >
        About
      </NavLink>
      <NavLink
        to="/contuct"
        activeStyle={{
          fontWeight: "bold",
          color: "blue",
        }}
      >
        Contuct
      </NavLink>
      <Link
        to="/services"
        activeStyle={{
          fontWeight: "bold",
          color: "blue",
        }}
      >
        Services
      </Link>
    </div>
  );
}

export default Header;
